// tabelaCars.js
import React from 'react';
import Car from '../Car';

const TabelaCars = ({ cars, carsFiltered, filterName, filterType, handleFilterNameChange, handleFilterTypeChange }) => {
    
  return (
    <div>
      <div className="row">
        <h2 className="text-uppercase" style={{ paddingTop: '25px', paddingBottom: '10px' }}>
          Filtriraj podatke :
        </h2>
        <div className="col-6 md" style={{ paddingTop: '5px' }}>
          <select
            className="form-control"
            name="type"
            value={filterName}
            onChange={handleFilterNameChange}
          >
            {/* ... (your existing code) */}
          </select>
        </div>
        <div className="col-6 md" style={{ paddingTop: '5px' }}>
          <select
            className="form-control"
            name="type"
            value={filterType}
            onChange={handleFilterTypeChange}
          >
            {/* ... (your existing code) */}
          </select>
        </div>
      </div>

      <table className="table table-striped">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Tip</th>
           
          </tr>
        </thead>
        <tbody>
          {carsFiltered.map((car, index) => (
            <Car
              key={index}
              car={car}
         
            />
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TabelaCars;
